summary.label:
Kids Watch is the companion app for Kids Smart Watch Phone. Parents and guardians can download this application to check child’s location, send and receive messages. 

Parent needs to register an account with mobile number, and then bind the smart watch by scanning the barcode displayed on the watch after power on, the  smart watch needs to have a working SIM card inside before binding. 

Uses can must register account and bind with kids smartwatch to view child’s watch locations, and also send/receive messages. The first parent to register and bind the kid’s smart watch will be the administrator, with extra features managed by administrator only:
1.	Bind, unbind and rebind watch;
2.	Add family members and friends;
3.	Change child profile and family member profile pictures;
4.	Watch settings
5.	Function control, including track history, school mode, location setting, power mode, etc.
6.	Geofence, setup safe or dangerous zone on the map to receive alert. 

If you have any questions, please contact email: zh-service@360.cn
